syntax = "proto3";

package Racket;

option swift_prefix="Model";


message Foo
{
    string name = 1;
    int32 num = 2;
}

message FooMeta
{
    bool cool = 1;
    string narm = 2;
}

message ImportantDocument
{
    string text = 1;
    int64 version = 2;
}
